      let response = await fetch(
        "https://laravel.louiseabrena.ca/api/projects"
      );
      let data = await response.json();
    //   console.log(data);
    setPortfolioProject(data.title);
    setProjectSource

    };
    getProject();
  }, []);

  return (
    <div>
      <h1>Projects</h1>
      <div>{portfolioProject}</div>
      <div>{projectSource}</div>
    </div>
  );
}
